const logIn = fname => {
    return { 
        type : 'LOG IN',
        payload : fname
    }
}

const register = fname => {
    return { 
        type : 'REGISTER',
        payload : fname
    }
}

const logOut = () => {
    return { 
        type : 'LOG OUT',
        payload : null
    }
}

export { logIn, register, logOut }
